import React from 'react'
import './App.css'
import Subsection from './Subsection.js'

class Section extends React.Component {




	render() {
		return (
			<div>
				<Subsection data={this.props.data.subsections}/>
				<br></br>
			</div>
		)
	}
}

export default Section;
